import { createIcon } from "../icon/createIcon";

export const InfoSecondaryIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="InfoSecondaryIcon">
    <path d="M12 0v12H0V0h12zm-1 1H1v10h10V1zM7 5v5H5V5h2zm0-3v2H5V2h2z" />
  </svg>,
  "InfoSecondary",
  "info secondary"
);
